import { Title } from './Title/' 

const Categories = () => {
    return (
        <section id="team" class="team section-bg">
            <div class="section-title">
                <h2>Shop</h2>
                <h3>Chose from our <span>Products</span></h3>
            </div>
        </section>
    )
}

export default Categories;
